    const { metadata, content } = JSON.parse(userInput) || "inv√°lido";

    const isBlipChatClick = checkBlipChatClick(content)
    const isInstagramClick = checkInstagramClick(content, metadata);
    const isWAClick = checkWAClick(metadata);

    let optionIdChoosed = null;

    if (isWAClick) {
      optionIdChoosed = 
      metadata["#wa.interactive.list.id"] ||
      metadata["#wa.interactive.button.id"] || 
      "inv√°lido";

    } else if (isBlipChatClick) {
      optionIdChoosed = content["button_id"] || "inv√°lido";

    } else if (isInstagramClick) {
      optionIdChoosed = isInstagramClick.value["button_id"] || "inv√°lido";

    }

    if (!optionIdChoosed) {
      const formattedContent = textNormalizer(content);
      return (
        optionsMenu.find((item) =>
            textNormalizer(item.title) === formattedContent ||
            textNormalizer(item.titleShort) === formattedContent
        ) || "inv√°lido"
      );
    }

    return (
      optionsMenu.find((item) => item.id === optionIdChoosed) || "inv√°lido"
    );
  } catch (e) {
