 * @param {Date} now UTC 
 * @param {Date} offset UTC offset 

 */
function checkAttendanceHourContainer(resource, now, offset) {
    offset = offset || -3;
    const UTCoffset = `${offset < 0 ? '-' : '+'}${String(Math.abs(offset)).padStart(2, '0')}:00`;
    const dayOfWeek = now.toLocaleDateString('en-US', { weekday: 'long' }).replace(/,.*$/, '');
    const date = now.toISOString().replace(/T.*$/, '');

    const isInside = Array.from(resource.attendanceHourScheduleItems || []).some((schedInItem) => {
        if (dayOfWeek.toUpperCase() === schedInItem.dayOfWeek.toUpperCase()) {
            const start = new Date(`${date}T${schedInItem.startTime}.000${UTCoffset}`);
            const end = new Date(`${date}T${schedInItem.endTime}.000${UTCoffset}`);
            return (now >= start) && (now <= end);
        }
        return false;
    });

    const isOutside = Array.from(resource.attendanceHourOffItems || []).some((schedOffItem) => {
        const start = new Date(`${schedOffItem.startDate.replace("Z","")}${UTCoffset}`);
        const end = new Date(`${schedOffItem.endDate.replace("Z","")}${UTCoffset}`);
        return (now >= start) && (now <= end);
    });

    return !isOutside && isInside;
}

function run(attendanceHourContainerCommandResponse, now) {
