	try{
        response = JSON.parse(attendanceHourContainerCommandResponse);
		if (String(response.status).toLowerCase() !== "success") {
            throw new Error("Failure");
        }
	} catch(err) {
		response = null;
	}

	return response && checkAttendanceHourContainer(response.resource, new Date(now));
}

